import {Route, BrowserRouter, Routes} from 'react-router-dom';
import {AppRoute} from '../../const';
import { useAppSelector } from '../../hooks/hooks';
// import { useAppSelector } from '../../hooks/hooks';
import MainCard from '../main-card';
import NotFoundPage from '../notfound-page';

function App(): JSX.Element {
  const guitars= useAppSelector(({DATA}) => DATA.guitars);
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path={AppRoute.Main}
          element={<MainCard guitars = {guitars.slice(0,9)}/>}
        />
        <Route
          path={AppRoute.Page1}
          element={<MainCard guitars = {guitars.slice(0,9)} />}
        />
        <Route
          path={AppRoute.Page2}
          element={<MainCard guitars = {guitars.slice(9,21)} />}
        />
        <Route
          path={AppRoute.Page3}
          element={<MainCard guitars = {guitars.slice(21,26)}/>}
        />
        <Route
          path="*"
          element={<NotFoundPage/>}
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
